let input = "";
let object = {};

input.split("").forEach(letter => {
    object[letter] = 0
})

input.split("").forEach(letter => {
    object[letter] += 1
})

let largest = 0;
Object.keys(object).forEach(letter => {
    if(object[letter] > largest){
        largest = object[letter]
    }
})

console.log(largest)